} struct FileDownloadRequest { file_name: PathBuf, authentication: AuthInfo,
} This design might work well enough. But now suppose you needed to support adding metadata that was protocol specific . For example, with NFS, you wanted to determine what their mount point was in order to enforce additional security rules. The way the current struct is designed leaves the protocol decision until runtime. That means any method that applies to one protocol and not the other requires the programmer to do a runtime check. Here is how getting an NFS mount point would look: struct FileDownloadRequest { file_name: PathBuf, authentication: AuthInfo, mount_point: Option<PathBuf>,
} impl FileDownloadRequest { // ... other methods ... /// Gets an NFS mount point if this is an NFS request. Otherwise, /// return None. pub fn mount_point(&self) -> Option<&Path> { self.mount_point.as_ref() }
} Every caller of mount_point() must check for None and write code to handle it. This is true even if they know only NFS requests are ever used in a given code path! It would be far more optimal to cause a compile-time error if the different request types were confused. After all, the entire path of the user's code, including what functions from the library they use, will know whether a request is an NFS request or a BOOTP request. In Rust, this is actually possible! The solution is to add a generic type in order to split the API. Here is what that looks like: use std::path::{Path, PathBuf}; mod nfs { #[derive(Clone)] pub(crate) struct AuthInfo(String); // NFS session management omitted
} mod bootp { pub(crate) struct AuthInfo(); // no authentication in bootp
} // private module, lest outside users invent their own protocol kinds!
